import React from 'react';
import { animated, useSpring } from '@react-spring/web';
import charizardImg from '../assets/charizard.png';

interface BirdProps {
  position: number;
  velocity: number;
}

const Bird: React.FC<BirdProps> = ({ position, velocity }) => {
  const spring = useSpring({
    from: { transform: 'translateY(0px) rotate(0deg)' },
    to: { 
      transform: `translateY(${position}px) rotate(${Math.min(Math.max(velocity * 5, -30), 90)}deg)`
    },
    config: { tension: 300 }
  });

  return (
    <animated.div
      style={{
        ...spring,
        width: '60px',
        height: '60px',
        position: 'absolute',
        left: '50px',
        zIndex: 2,
        backgroundImage: `url(${charizardImg})`,
        backgroundSize: 'contain',
        backgroundRepeat: 'no-repeat',
        backgroundPosition: 'center',
      }}
    />
  );
};

export default Bird;
